// Filename - Main.jsx
import React from "react";
import objects from "../main-objects"
import image1 from "../images/image.png"
import image2 from "../images/medal.png"
import image3 from "../images/watch.png"
import image4 from "../images/elephant.png"
import image5 from "../images/jewelry.png"
import image6 from "../images/sewing.png"

export default function Main() {
	const objElements = objects.map(object => <img key={object.id} src={`../images/${object.url}`} />)

    return (
		<div className="main">
			{objElements}
		</div>
    )
}
